					type="text"
					className="form-control"
					placeholder="Opis"
					aria-label="Opis"
					aria-describedby="basic-addon1"
				/>
				{console.log(props.testo)}
            <button onClick={props.click}>Dodaj</button>
		</div>
	);
}
